    //convertArrayToString() -> converts the array to a format ready for sending
    func convertArrayToString(array: [[String]]) -> String {
        var returnData = ""
        for nestedArray in array {
            for value in nestedArray {
                returnData = returnData + value + " "
            }
        }
        return returnData
    }
